INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, "2030/12/17 14:59:59", 102301, 24, 2, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, "アヤネ", 24001, 10046, "2020/07/31 12:00:00", 2, 401);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2.21, "2030/12/17 14:59:59", 102301, 24, 1, 0.0, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 0.0, "アヤネ", 24002, 10046, "2020/07/31 12:00:00", 2, 402);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, "2030/12/17 14:59:59", 102301, 24, 2, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, "アヤネ", 24003, 10046, "2020/07/31 12:00:00", 2, 403);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (1.99, "2030/12/17 14:59:59", 192201, 24, 2, 0.0, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 0.0, "アサヒ", 24004, 10046, "2020/07/31 12:00:00", 1, 701);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2.21, "2030/12/17 14:59:59", 192201, 24, 1, 0.0, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 0.0, "アサヒ", 24005, 10046, "2020/07/31 12:00:00", 2, 702);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (3.33, "2030/12/17 14:59:59", 192201, 24, 2, 0.0, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 0.0, "アサヒ", 24006, 10046, "2020/07/31 12:00:00", 1, 703);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, "2030/12/17 14:59:59", 192301, 24, 2, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, "部員３", 24007, 10046, "2020/07/31 12:00:00", 2, 801);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2.68, "2030/12/17 14:59:59", 192301, 24, 1, 0.0, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 0.0, "部員３", 24008, 10046, "2020/07/31 12:00:00", 2, 802);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, "2030/12/17 14:59:59", 192301, 24, 2, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, "部員３", 24009, 10046, "2020/07/31 12:00:00", 2, 803);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, "2030/12/17 14:59:59", 192501, 24, 1, 0.0, "やった！", 0.0, "", 24010, 10046, "2020/07/31 12:00:00", 1, 501);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, "2030/12/17 14:59:59", 192501, 24, 1, 0.0, "勝ったよ！", 0.0, "", 24011, 10046, "2020/07/31 12:00:00", 1, 502);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, "2030/12/17 14:59:59", 192501, 24, 1, 0.0, "いい調子！", 0.0, "", 24012, 10046, "2020/07/31 12:00:00", 1, 503);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (5.33, "2030/12/17 14:59:59", 113501, 24, 6, 0.0, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 0.0, "ミサト", 24013, 10046, "2020/07/31 12:00:00", 2, 111);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (6.85, "2030/12/17 14:59:59", 113501, 24, 1, 0.0, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 0.0, "ミサト", 24014, 10046, "2020/07/31 12:00:00", 2, 112);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (3.0, "2030/12/17 14:59:59", 113501, 24, 1, 0.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 0.0, "ミサト", 24015, 10046, "2020/07/31 12:00:00", 2, 113);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (6.11, "2030/12/17 14:59:59", 192401, 24, 1, 0.0, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 0.0, "ダイチ", 24016, 10046, "2020/07/31 12:00:00", 2, 611);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (6.75, "2030/12/17 14:59:59", 192401, 24, 1, 0.0, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 0.0, "ダイチ", 24017, 10046, "2020/07/31 12:00:00", 2, 612);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, "2030/12/17 14:59:59", 192401, 24, 2, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, "ダイチ", 24018, 10046, "2020/07/31 12:00:00", 2, 613);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (4.52, "2030/12/17 14:59:59", 113401, 24, 2, 0.0, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 0.0, "ハツネ", 24019, 10046, "2020/07/31 12:00:00", 1, 211);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (3.89, "2030/12/17 14:59:59", 113401, 24, 2, 0.0, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 0.0, "ハツネ", 24020, 10046, "2020/07/31 12:00:00", 1, 212);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (13.49, "2030/12/17 14:59:59", 113401, 24, 1, 0.0, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 0.0, "ハツネ", 24021, 10046, "2020/07/31 12:00:00", 2, 213);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (3.17, "2030/12/17 14:59:59", 106501, 24, 1, 0.0, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 0.0, "カヤ", 24022, 10046, "2020/07/31 12:00:00", 2, 311);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (4.42, "2030/12/17 14:59:59", 106501, 24, 1, 0.0, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 0.0, "カヤ", 24023, 10046, "2020/07/31 12:00:00", 2, 312);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (2.89, "2030/12/17 14:59:59", 106501, 24, 6, 0.0, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 0.0, "カヤ", 24024, 10046, "2020/07/31 12:00:00", 1, 313);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (3.71, "2030/12/17 14:59:59", 102301, 24, 4, 0.0, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 0.0, "アヤネ", 24025, 10046, "2020/07/31 12:00:00", 3, 421);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (5.1, "2030/12/17 14:59:59", 192201, 24, 2, 0.0, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 0.0, "アサヒ", 24026, 10046, "2020/07/31 12:00:00", 1, 721);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (4.34, "2030/12/17 14:59:59", 192301, 24, 1, 0.0, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 0.0, "部員３", 24027, 10046, "2020/07/31 12:00:00", 3, 821);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, "2030/12/17 14:59:59", 192501, 24, 1, 0.0, "いい勝負だったよ\nまたやろうね", 0.0, "", 24028, 10046, "2020/07/31 12:00:00", 1, 521);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (5.62, "2030/12/17 14:59:59", 113501, 24, 1, -360.0, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 0.0, "ミサト", 24029, 10046, "2020/07/31 12:00:00", 2, 101);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (9.58, "2030/12/17 14:59:59", 113501, 24, 1, -360.0, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 0.0, "ミサト", 24030, 10046, "2020/07/31 12:00:00", 2, 102);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (0.0, "2030/12/17 14:59:59", 113501, 24, 2, -360.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, "ミサト", 24031, 10046, "2020/07/31 12:00:00", 2, 103);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (9.13, "2030/12/17 14:59:59", 113501, 24, 2, -360.0, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 0.0, "ミサト", 24032, 10046, "2020/07/31 12:00:00", 1, 104);
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES (8.27, "2030/12/17 14:59:59", 113501, 24, 1, -360.0, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 0.0, "ミサト", 24033, 10046, "2020/07/31 12:00:00", 2, 105);
